def binary_search_rec(alist, start, end, key) : 
	"""Search key in alist[start... end - 1]."""
	if not start < end : 
		return -1
	mid = (start + end)//2
	if alist[mid] < key : 
		return binary_search_rec(alist, mid + 1, end, key)
	elif alist[mid] > key : 
		return binary_search_rec(alist, start, mid, key)
	else : 
		return mid
