	sum_ = 0
	temp = no_
	while temp > 0 : 
		digit = temp % 10
		sum_ += digit ** 3 
		temp //= 10
	if no_ == sum_ :   
		print(f"{no_} is an Armstrong number")  
	else :   
		print(f"{no_} is not an Armstrong number")'

