def findTargetSumWays(nums, S) : 
	count = 0
	def calculate(nums, i, sum, S) : 
		nonlocal count
		if i == len(nums) : 
			if sum == S : 
				count += 1
		else : 
			calculate(nums, i+1, sum+ nums[i], S)
			calculate(nums, i+1, sum- nums[i], S)
	calculate(nums, 0, 0, S) 
	return count'

