def combinationSum(candidates, target) : 
	results = []
	def helper(i, path) : 
		if sum(path) == target : 
			results.append(path[ : ])
			return
		if sum(path) > target : 
			return
		for x in range(i, len(candidates)) : 
			path.append(candidates[x])
			helper(x, path)
			path.pop()
	helper(0, []) 
	return results'

