def dailyTemperatures(T) : 
	stack = []
	res = [0 for _ in range(len(T))]
	for i, t1 in enumerate(T) : 
		while stack and t1 > stack[-1][1] : 
			j, t2 = stack.pop()
			res[j] = i - j
		stack.append((i, t1))
