	elif adjacent_side == str("x") : 
		return "Adjacent = " + str(((hypotenuse ** 2) - (opposite_side ** 2)) ** 0.5)
	elif hypotenuse == str("x") : 
		return "Hypotenuse = " + str(((opposite_side ** 2) + (adjacent_side ** 2)) ** 0.5)
	else : 
		return "You know the answer!"
