def binary_search(alist, key) : 
	"""Search key in alist[start... end - 1]."""
	start = 0
	end = len(alist)
	while start < end : 
		mid = (start + end)//2
		if alist[mid] > key : 
			end = mid
		elif alist[mid] < key : 
			start = mid + 1
		else : 
			return mid
	return -1
