		self.cache = {1 : 1, 2 : 1}
	def fib(self, n) : 
		if n not in self.cache : 
			print(f'Calculating fib({n})')
			self.cache[n] = self.fib(n-1) + self.fib(n-2)
		return self.cache[n]"

