def gcd(num1, num2) : 
	gcd = 1  
	if num1 % num2 == 0 : 
		return num2
	for k in range(int(num2 / 2), 0, -1) : 
		if num1 % k == 0 and num2 % k == 0 : 
			gcd = k
			break  
	return gcd'

'
def lcm(num1, num2) : 
	if num1 > num2 : 
		z = num1
	else : 
		z = num2
	while(True) : 
		if((z % num1 == 0) and (z % num2 == 0)) : 
			lcm = z
			break
		z += 1
	return lcm'

