def calc_median(arr) : 
	arr = sorted(arr)
	if len(arr) / 2 == 0 : 
		return arr[len(arr) / 2]
	else : 
		return (arr[len(arr) // 2] + arr[(len(arr) - 1) // 2]) / 2'

